A Coach Trainer is a type of Pokemon Trainer introduced in Pokemon: Lets Go, Pikachu! and Lets Go, Eevee! Coach Trainers are encountered throughout the story to help train the player, often rewarding them with a specific TM or several Candies upon being defeated. 🙅‍♂️🙋‍♀️
